
File References:
- Podfile
- Frameworks: []
- Pods:
  - Moment:
    - parseIt.ym
    - TimeParser.c
    - TimeParser.h
    - tokeIt.l
    - Support Files:
      - Moment-dummy.m
      - Moment-prefix.pch
      - Moment.debug.xcconfig
      - Moment.release.xcconfig
- Products:
  - Moment
  - Pods-SampleApp
- Targets Support Files:
  - Pods-SampleApp:
    - Pods-SampleApp-acknowledgements.markdown
    - Pods-SampleApp-acknowledgements.plist
    - Pods-SampleApp-dummy.m
    - Pods-SampleApp.debug.xcconfig
    - Pods-SampleApp.release.xcconfig



Targets:
- Moment:
    Build Phases:
    - Headers:
      - TimeParser.h:
          ATTRIBUTES:
          - Project
    - Sources:
      - Moment-dummy.m
      - parseIt.ym
      - TimeParser.c:
          COMPILER_FLAGS: "-fno-objc-arc"
      - tokeIt.l
    - Frameworks: []
    Build Configurations:
    - Debug:
        Build Settings:
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          CLANG_ENABLE_OBJC_WEAK: 'NO'
          CODE_SIGN_IDENTITY[sdk=appletvos*]: ''
          CODE_SIGN_IDENTITY[sdk=iphoneos*]: ''
          CODE_SIGN_IDENTITY[sdk=watchos*]: ''
          ENABLE_MODULE_VERIFIER: 'NO'
          ENABLE_USER_SCRIPT_SANDBOXING: 'NO'
          GCC_PREFIX_HEADER: Target Support Files/Moment/Moment-prefix.pch
          GENERATE_INFOPLIST_FILE: 'NO'
          IPHONEOS_DEPLOYMENT_TARGET: '4.3'
          OTHER_LDFLAGS: ''
          OTHER_LIBTOOLFLAGS: ''
          PRIVATE_HEADERS_FOLDER_PATH: ''
          PRODUCT_MODULE_NAME: Moment
          PRODUCT_NAME: Moment
          PUBLIC_HEADERS_FOLDER_PATH: ''
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          SWIFT_ACTIVE_COMPILATION_CONDITIONS: "$(inherited) "
          SWIFT_INSTALL_OBJC_HEADER: 'YES'
          TARGETED_DEVICE_FAMILY: '1,2'
        Base Configuration: Moment.debug.xcconfig
    - Release:
        Build Settings:
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          CLANG_ENABLE_OBJC_WEAK: 'NO'
          CODE_SIGN_IDENTITY[sdk=appletvos*]: ''
          CODE_SIGN_IDENTITY[sdk=iphoneos*]: ''
          CODE_SIGN_IDENTITY[sdk=watchos*]: ''
          ENABLE_MODULE_VERIFIER: 'NO'
          ENABLE_USER_SCRIPT_SANDBOXING: 'NO'
          GCC_PREFIX_HEADER: Target Support Files/Moment/Moment-prefix.pch
          GENERATE_INFOPLIST_FILE: 'NO'
          IPHONEOS_DEPLOYMENT_TARGET: '4.3'
          OTHER_LDFLAGS: ''
          OTHER_LIBTOOLFLAGS: ''
          PRIVATE_HEADERS_FOLDER_PATH: ''
          PRODUCT_MODULE_NAME: Moment
          PRODUCT_NAME: Moment
          PUBLIC_HEADERS_FOLDER_PATH: ''
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          SWIFT_ACTIVE_COMPILATION_CONDITIONS: "$(inherited) "
          SWIFT_INSTALL_OBJC_HEADER: 'YES'
          TARGETED_DEVICE_FAMILY: '1,2'
          VALIDATE_PRODUCT: 'YES'
        Base Configuration: Moment.release.xcconfig
- Pods-SampleApp:
    Build Phases:
    - Headers: []
    - Sources:
      - Pods-SampleApp-dummy.m
    - Frameworks: []
    Build Configurations:
    - Debug:
        Build Settings:
          ALWAYS_EMBED_SWIFT_STANDARD_LIBRARIES: 'NO'
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          CODE_SIGN_IDENTITY[sdk=appletvos*]: ''
          CODE_SIGN_IDENTITY[sdk=iphoneos*]: ''
          CODE_SIGN_IDENTITY[sdk=watchos*]: ''
          ENABLE_MODULE_VERIFIER: 'NO'
          ENABLE_USER_SCRIPT_SANDBOXING: 'NO'
          IPHONEOS_DEPLOYMENT_TARGET: '6.0'
          MACH_O_TYPE: staticlib
          OTHER_LDFLAGS: ''
          OTHER_LIBTOOLFLAGS: ''
          PODS_ROOT: "$(SRCROOT)"
          PRODUCT_BUNDLE_IDENTIFIER: org.cocoapods.${PRODUCT_NAME:rfc1034identifier}
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          TARGETED_DEVICE_FAMILY: '1,2'
        Base Configuration: Pods-SampleApp.debug.xcconfig
    - Release:
        Build Settings:
          ALWAYS_EMBED_SWIFT_STANDARD_LIBRARIES: 'NO'
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          CODE_SIGN_IDENTITY[sdk=appletvos*]: ''
          CODE_SIGN_IDENTITY[sdk=iphoneos*]: ''
          CODE_SIGN_IDENTITY[sdk=watchos*]: ''
          ENABLE_MODULE_VERIFIER: 'NO'
          ENABLE_USER_SCRIPT_SANDBOXING: 'NO'
          IPHONEOS_DEPLOYMENT_TARGET: '6.0'
          MACH_O_TYPE: staticlib
          OTHER_LDFLAGS: ''
          OTHER_LIBTOOLFLAGS: ''
          PODS_ROOT: "$(SRCROOT)"
          PRODUCT_BUNDLE_IDENTIFIER: org.cocoapods.${PRODUCT_NAME:rfc1034identifier}
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          TARGETED_DEVICE_FAMILY: '1,2'
          VALIDATE_PRODUCT: 'YES'
        Base Configuration: Pods-SampleApp.release.xcconfig



Build Configurations:
- Debug:
    Build Settings:
      ALWAYS_SEARCH_USER_PATHS: 'NO'
      CLANG_ANALYZER_LOCALIZABILITY_NONLOCALIZED: 'YES'
      CLANG_ANALYZER_NONNULL: 'YES'
      CLANG_ANALYZER_NUMBER_OBJECT_CONVERSION: YES_AGGRESSIVE
      CLANG_CXX_LANGUAGE_STANDARD: gnu++14
      CLANG_CXX_LIBRARY: libc++
      CLANG_ENABLE_MODULES: 'YES'
      CLANG_ENABLE_OBJC_ARC: 'YES'
      CLANG_ENABLE_OBJC_WEAK: 'YES'
      CLANG_WARN_BLOCK_CAPTURE_AUTORELEASING: 'YES'
      CLANG_WARN_BOOL_CONVERSION: 'YES'
      CLANG_WARN_COMMA: 'YES'
      CLANG_WARN_CONSTANT_CONVERSION: 'YES'
      CLANG_WARN_DEPRECATED_OBJC_IMPLEMENTATIONS: 'YES'
      CLANG_WARN_DIRECT_OBJC_ISA_USAGE: YES_ERROR
      CLANG_WARN_DOCUMENTATION_COMMENTS: 'YES'
      CLANG_WARN_EMPTY_BODY: 'YES'
      CLANG_WARN_ENUM_CONVERSION: 'YES'
      CLANG_WARN_INFINITE_RECURSION: 'YES'
      CLANG_WARN_INT_CONVERSION: 'YES'
      CLANG_WARN_NON_LITERAL_NULL_CONVERSION: 'YES'
      CLANG_WARN_OBJC_IMPLICIT_RETAIN_SELF: 'YES'
      CLANG_WARN_OBJC_LITERAL_CONVERSION: 'YES'
      CLANG_WARN_OBJC_ROOT_CLASS: YES_ERROR
      CLANG_WARN_QUOTED_INCLUDE_IN_FRAMEWORK_HEADER: 'YES'
      CLANG_WARN_RANGE_LOOP_ANALYSIS: 'YES'
      CLANG_WARN_STRICT_PROTOTYPES: 'YES'
      CLANG_WARN_SUSPICIOUS_MOVE: 'YES'
      CLANG_WARN_UNGUARDED_AVAILABILITY: YES_AGGRESSIVE
      CLANG_WARN_UNREACHABLE_CODE: 'YES'
      CLANG_WARN__DUPLICATE_METHOD_MATCH: 'YES'
      COPY_PHASE_STRIP: 'NO'
      DEBUG_INFORMATION_FORMAT: dwarf
      ENABLE_STRICT_OBJC_MSGSEND: 'YES'
      ENABLE_TESTABILITY: 'YES'
      GCC_C_LANGUAGE_STANDARD: gnu11
      GCC_DYNAMIC_NO_PIC: 'NO'
      GCC_NO_COMMON_BLOCKS: 'YES'
      GCC_OPTIMIZATION_LEVEL: '0'
      GCC_PREPROCESSOR_DEFINITIONS:
      - POD_CONFIGURATION_DEBUG=1
      - DEBUG=1
      - "$(inherited)"
      GCC_WARN_64_TO_32_BIT_CONVERSION: 'YES'
      GCC_WARN_ABOUT_RETURN_TYPE: YES_ERROR
      GCC_WARN_UNDECLARED_SELECTOR: 'YES'
      GCC_WARN_UNINITIALIZED_AUTOS: YES_AGGRESSIVE
      GCC_WARN_UNUSED_FUNCTION: 'YES'
      GCC_WARN_UNUSED_VARIABLE: 'YES'
      IPHONEOS_DEPLOYMENT_TARGET: '6.0'
      MTL_ENABLE_DEBUG_INFO: INCLUDE_SOURCE
      MTL_FAST_MATH: 'YES'
      ONLY_ACTIVE_ARCH: 'YES'
      PRODUCT_NAME: "$(TARGET_NAME)"
      STRIP_INSTALLED_PRODUCT: 'NO'
      SWIFT_ACTIVE_COMPILATION_CONDITIONS: DEBUG
      SWIFT_OPTIMIZATION_LEVEL: "-Onone"
      SWIFT_VERSION: '5.0'
      SYMROOT: "${SRCROOT}/../build"
- Release:
    Build Settings:
      ALWAYS_SEARCH_USER_PATHS: 'NO'
      CLANG_ANALYZER_LOCALIZABILITY_NONLOCALIZED: 'YES'
      CLANG_ANALYZER_NONNULL: 'YES'
      CLANG_ANALYZER_NUMBER_OBJECT_CONVERSION: YES_AGGRESSIVE
